import logo from '../../img/logo_auth.png'

function Register(){
    return (
        <div className="register">
            <header className="flex flex-col">
                <img src={logo} alt="" width="200"/>
                <h2>Monorts</h2>
            </header>
        </div>
    )

}

export default Register
